import "./mainPage.css";
import { AnimatePresence, motion } from "framer-motion";
import gsap from "gsap";
import { useEffect, useState } from "react";

const images = [
  {
    image:
      "https://upload.wikimedia.org/wikipedia/commons/a/a4/Anatomy_of_a_Sunset-2.jpg",
  },
  {
    image:
      "https://static.israel21c.org/www/uploads/2018/07/israel-sunset-ashkelon-september-1520x855.jpg",
  },
];

function MainPage() {
  const [loadedImages, setLoadedImages] = useState([false, false]);

  useEffect(() => {
    const screenHeight = window.innerHeight;
    const startX = screenHeight / 2;
    const offset = parseInt("50px", 10);
    const startY = startX - offset;
    /* eslint-disable */console.log(...oo_oo(`3238858823_25_4_25_23_4`,startX));

    gsap.fromTo(
      ".circle",
      { y: startY },
      { delay: 2, duration: 2, y: 0, ease: "slow" }
    );
  }, []);

  const handleImageLoad = (index: number) => {
    const newLoadedImages = [...loadedImages];
    newLoadedImages[index] = true;
    setLoadedImages(newLoadedImages);
  };

  return (
    <AnimatePresence>
      <div className="container">
        <motion.svg
          className="circle"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 5 }}
          width="100"
          height="50"
          viewBox="0 0 512 422"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
