            fill="black"
          />
        </motion.svg>
        <picture className="imageContainer">
          {images.map((image, i) => (
            <img
              key={i}
              alt="images"
              src={image.image}
              width={200}
              height={100}
              style={{
                display: loadedImages[i] ? "block" : "none",
                transition: `${display} 0.3s ease`,
              }}
              onLoad={() => handleImageLoad(i)}
            />
          ))}
        </picture>
      </div>
    </AnimatePresence>
  );
}

